import{_ as a,c as t,o as e,aa as i}from"./chunks/framework.d_Ke7vMG.js";const R=JSON.parse('{"title":"RabbitMQ实战指南","description":"","frontmatter":{"title":"RabbitMQ实战指南","author":"Herman","updateTime":"2021-08-14 13:41","desc":"书籍","categories":"书籍","tags":"书籍/PDF","outline":"deep"},"headers":[],"relativePath":"Notes/No5Books/RabbitMQ实战指南.md","filePath":"Notes/No5Books/RabbitMQ实战指南.md","lastUpdated":1723563552000}'),b={name:"Notes/No5Books/RabbitMQ实战指南.md"},o=i('<h1 id="rabbitmq实战指南" tabindex="-1">RabbitMQ实战指南 <a class="header-anchor" href="#rabbitmq实战指南" aria-label="Permalink to &quot;RabbitMQ实战指南&quot;">​</a></h1><p><img src="https://raw.githubusercontent.com/silently9527/images/main/008i3skNgy1gu51aulfglj604605kjr702.jpg" alt=""></p><h1 id="内容介绍" tabindex="-1">内容介绍 <a class="header-anchor" href="#内容介绍" aria-label="Permalink to &quot;内容介绍&quot;">​</a></h1><p>这书从消息中间件的定义和RabbitMQ的历史时间选择，关键论述RabbitMQ的安裝、应用、配备、管理方法、运维管理、基本原理、拓展等层面的关键点。这书大概能够分成基本篇、实战篇和进阶篇3个一部分。</p><p>基本篇最先详细介绍RabbitMQ的基础安裝及应用方法，便捷初学者的用户以*舒服的方法融进到RabbitMQ当中。 次之详细介绍RabbitMQ的基本要素，包含经营者、顾客、空调交换器、序列、关联等。以后根据Java語言叙述了手机客户端怎样与RabbitMQ创建（关掉）联接、申明（删掉）空调交换器、序列、关联关联，及其怎样推送和消費信息等。</p><p>实战篇叙述RabbitMQ的 TTL、死信、延迟时间序列、优先序列、RPC、信息持久化、生产制造端和消費web端信息确定体制等內容，以求用户可以把握RabbitMQ的应用精粹。</p><p>这书正中间篇数关键从RabbitMQ 的管理方法、配备、运维管理这3个视角来为用户出示帮助文件及解决困难的构思。进阶篇关键论述RabbitMQ的储存体制、流控及镜像系统序列的基本原理， 深层次地叙述RabbitMQ的某些保持关键点，有利于用户加重对RabbitMQ的了解。这书还涉及到互联网系统分区的定义，此內容可称之为恶魔篇，必须把握前边的全部內容才可了解在其中的路子。</p><p>这书*后叙述的是RabbitMQ的某些拓展內容及附则，供用户参照的用处。</p><h1 id="下载地址" tabindex="-1">下载地址 <a class="header-anchor" href="#下载地址" aria-label="Permalink to &quot;下载地址&quot;">​</a></h1><blockquote><p><a href="http://share.silently9527.cn/f/30732796-488966904-ec1511" target="_blank" rel="noreferrer">http://share.silently9527.cn/f/30732796-488966904-ec1511</a></p></blockquote><p>免责声明 电子书书籍全部来源于网络其他人的整理，这里只是收集整理了他们的链接，只做学习和交流使用，版权归原作者所有，如有侵权，请马上联系我，我立马删除对应链接。邮箱：380303318@qq.com</p>',11),r=[o];function s(n,c,l,p,_,h){return e(),t("div",null,r)}const m=a(b,[["render",s]])